import { useEffect, useState } from 'react';
import axios, { AxiosResponse } from 'axios';
import React from 'react';
import { stylesheet } from 'typestyle';

const styles = stylesheet({
    dashboardList: {
        color: 'red',
    },
});

type DashboardProps = {
    companies: string[];
};

export function Dashboard({ companies }) {
    //todo add a spinner
    if (typeof companies === 'undefined') return <div className="App">Nothing here</div>;

    return <div className={styles.dashboardList}>{companies.map((company) => company.name)}</div>;
}
